  return (
    <div className={ classes.work } key={ props.n } >

      <div className={ classes.firstDiv } >
        <p> { classes.text } </p>
      </div>
      <div className={ classes.secondDiv } >
        <Button className={ classes.buttoncha }>x</Button>
      </div>

      {/* <span className={ classes.spancha } > { props.text } </span>
      <Button className={ classes.buttoncha } >x</Button> */}
    </div>
  )
}
